pub fn get_redshift_root_grammar_id() -> GrammarId {
    GrammarId(4807)
}
pub fn get_redshift_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_redshift_root_grammar_id(),
        tables: &REDSHIFT_TABLES,
    }
}
pub fn get_redshift_root_grammar() -> RootGrammar {
    get_redshift_root_grammar_table()
}
